selector_to_html = {"a[href=\"#equation-eq-lec5-ex2-sol-uncertainty\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec5-ex2-sol-uncertainty\">\n\\[\n\\lvert \\Delta(i \\omega) \\lvert \\leq \\frac{0.9}{\\sqrt{1 + \\omega^2}} = \\left\\lvert \\frac{0.9}{1 + i \\omega} \\right\\lvert\n\\]</div>", "a[href=\"#fig-lec5-ex2-sol-block\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex2-sol-block\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex2-block.svg\"><img alt=\"../_images/ex2-block.svg\" src=\"../_images/ex2-block.svg\" style=\"width: 750px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 46 </span><span class=\"caption-text\">Block diagram of the control system</span><a class=\"headerlink\" href=\"#fig-lec5-ex2-sol-block\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"exercise-5.0-solutions.html#equation-eq-lec5-ex0-sol-complementary-sensitivity\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec5-ex0-sol-complementary-sensitivity\">\n\\[\\begin{split}\n\\lvert T(i \\omega) \\lvert_{\\text{dB}} \\approx \\begin{dcases}\n    0 \\text{ dB } &amp; \\text{where } \\lvert G_o (i \\omega)\\lvert_{\\text{dB}} &gt; 0dB \\\\\n    \\lvert G_o(i \\omega) \\lvert_{\\text{dB}} &amp;  \\text{where }  \\lvert G_o (i \\omega)\\lvert_{\\text{dB}} &lt; 0dB\n\\end{dcases}\n\\end{split}\\]</div>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>The nominal complementary sensitivity transfer function <span class=\"math notranslate nohighlight\">\\(T(s)\\)</span> is defined as</p>", "a[href=\"#solutions-of-exercise-5-2\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 5.2<a class=\"headerlink\" href=\"#solutions-of-exercise-5-2\" title=\"Link to this heading\">#</a></h1><p>The controller <span class=\"math notranslate nohighlight\">\\(F(s) = \\frac{s+10}{s}\\)</span> was designed assuming that the system <span class=\"math notranslate nohighlight\">\\(G^0(s)\\)</span> was identical to the model <span class=\"math notranslate nohighlight\">\\(G(s) = \\frac{1}{s+10}\\)</span>.\nIn <a class=\"reference internal\" href=\"#fig-lec5-ex2-sol-bode\"><span class=\"std std-numref\">Fig. 47</span></a>, the <strong>nominal</strong> open-loop transfer function <span class=\"math notranslate nohighlight\">\\(G_o(s) = F(s) \\cdot G(s)\\)</span>.</p>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>The ancillary assumptions of Criterion 6.2 (Criterion for robustness to model mismatch) are satisfied. To verify whether <span class=\"math notranslate nohighlight\">\\(F(s)\\)</span> guarantees the closed-loop stability for the real system <span class=\"math notranslate nohighlight\">\\(G^0(s)\\)</span>, we need to:</p>", "a[href=\"#fig-lec5-ex2-sol-delta-sketch\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex2-sol-delta-sketch\">\n<a class=\"reference internal image-reference\" href=\"../_images/ba2613bea6c96390260c944cb486f9cdce9ae02cb81b19c7b3d8213a4d83be95.png\"><img alt=\"../_images/ba2613bea6c96390260c944cb486f9cdce9ae02cb81b19c7b3d8213a4d83be95.png\" src=\"../_images/ba2613bea6c96390260c944cb486f9cdce9ae02cb81b19c7b3d8213a4d83be95.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 49 </span><span class=\"caption-text\">Sketch of the magnitude plot of <span class=\"math notranslate nohighlight\">\\(\\Delta(i \\omega)\\)</span>.</span><a class=\"headerlink\" href=\"#fig-lec5-ex2-sol-delta-sketch\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#fig-lec5-ex2-sol-t-sketch\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex2-sol-t-sketch\">\n<a class=\"reference internal image-reference\" href=\"../_images/5a5d134cb4f8b8f99a4dcba72c93e255f4fb40362c015ead1c70f12c12f31e00.png\"><img alt=\"../_images/5a5d134cb4f8b8f99a4dcba72c93e255f4fb40362c015ead1c70f12c12f31e00.png\" src=\"../_images/5a5d134cb4f8b8f99a4dcba72c93e255f4fb40362c015ead1c70f12c12f31e00.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 48 </span><span class=\"caption-text\">Sketch of the nominal complementary sensitivity function\u2019s bode plot.</span><a class=\"headerlink\" href=\"#fig-lec5-ex2-sol-t-sketch\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#fig-lec5-ex2-sol-comparison\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex2-sol-comparison\">\n<a class=\"reference internal image-reference\" href=\"../_images/23df2ee632e75db65e92a0f31c7b8e958f1c49ea39117f1630458c7ad740496f.png\"><img alt=\"../_images/23df2ee632e75db65e92a0f31c7b8e958f1c49ea39117f1630458c7ad740496f.png\" src=\"../_images/23df2ee632e75db65e92a0f31c7b8e958f1c49ea39117f1630458c7ad740496f.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 50 </span><span class=\"caption-text\">Comparison between <span class=\"math notranslate nohighlight\">\\(\\lvert T(i \\omega) \\lvert_{\\text{dB}}\\)</span> and <span class=\"math notranslate nohighlight\">\\(-\\lvert \\Delta(i \\omega) \\lvert_{\\text{dB}}\\)</span>.</span><a class=\"headerlink\" href=\"#fig-lec5-ex2-sol-comparison\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#fig-lec5-ex2-sol-bode\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex2-sol-bode\">\n<a class=\"reference internal image-reference\" href=\"../_images/7b7d448f84aa0fb495c58cd2cdb65420dbcdad9cfed44265f916756d055b1428.png\"><img alt=\"../_images/7b7d448f84aa0fb495c58cd2cdb65420dbcdad9cfed44265f916756d055b1428.png\" src=\"../_images/7b7d448f84aa0fb495c58cd2cdb65420dbcdad9cfed44265f916756d055b1428.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 47 </span><span class=\"caption-text\">Magnitude Bode plot of the nominal open-loop transfer function <span class=\"math notranslate nohighlight\">\\(G_o(s)\\)</span>.</span><a class=\"headerlink\" href=\"#fig-lec5-ex2-sol-bode\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>The nominal complementary sensitivity transfer function <span class=\"math notranslate nohighlight\">\\(T(s)\\)</span> is defined as</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
